import React from "react";
import "./App.css";
import MenuItem from "./MenuItem";
import TopNav from "./TopNav";

function App() {
	return (
		<div className="App">
			<TopNav />
			<MenuItem id="Carne Asada" price="9.25" />
			<MenuItem id="Barbacoa" price="8.50" />
			<MenuItem id="Steak" price="8.50" />
			<MenuItem id="Chicken" price="7.95" />
			<MenuItem id="Carnitas" price="" />
			<MenuItem id="Sofritas" price="" />
		</div>
	);
}

export default App;
